	module.exports = {"data":{"markdownRemark":{"html":"<p>C’est un peu une mise en pratique de la politique de <a href=\"#rural_offshore\">rural offshore</a> chère à Marmelab. Non, ce nouveau blog ne sera pas le journal de mon déménagement, mais ce projet de retour en province me semble un moment propice pour améliorer ma compétence en communication.\nÀ paris, c’est trop facile : tous ces meetups, ces conférences, ces collègues de travail... Non pas que je risque de me retrouver seul dans le désert à Caen, mais pour garder cet esprit de partage parisien, je me prépare sans regret à devoir autant donner que recevoir.\nCommuniquer activement donc, en commençant par ce blog. Et puis écrire c'est sans doute <a href=\"#ecrire\">une vraie bonne habitude</a>, même si ce que l’on écrit n’a rien de révolutionnaire.\nEt au-delà du blog, j’espère rencontrer rapidement les membres de la <a href=\"http://www.meetup.com/fr-FR/Coding-School-Meetup-Group\">Coding School</a>, de la <a href=\"http://www.meetup.com/fr-FR/Fabrique-de-services-Normandy-Frenchtech/\">fabrique de services</a>, du <a href=\"http://www.forum-digital.fr/\">forum digital</a>, du <a href=\"http://www.club-agile-caen.fr/\">club agile de Caen</a>...</p>\n<h1>Une application pour déménager</h1>\n<p><strong><em>Road to Caen</em></strong>, c’est le nom de mon nouveau side project. Une des premières choses à faire quand on déménage, c’est de penser à un nouvel appartement. Et c’est plutôt sympa de chercher un appartement en province quand on vient de Paris, on se rend compte qu’on n’est pas obligé de donner un bras pour avoir un logement. Le projet ne va pas consister en une sorte de mashup d’annonces immobilières, mais devra aider à trouver la bonne localisation de cet appartement. La qualité de la localisation va dépendre de critères plus ou moins subjectifs, mais c’est une des qualités des sides projects : on est toujours d’équerre avec le product owner.</p>\n<p>Ces critères seront donc :</p>\n<ul>\n<li><strong>Le collège et l’école de rattachement de l’adresse</strong>: j’ai deux filles. Il n’est ici aucunement question de remettre en cause le principe de la carte scolaire et l’importance de l’école publique. Il se trouve que ce principe nous a plongés dans des affres de déception, voire de colère sur Paris. C’est donc un point important.</li>\n<li>Ensuite, <strong>la distance à des points notables</strong>, comme la gare (le principe du rural shore, c’est aussi d’être rapidement sur Paris), les espaces de coworking, les salles de concert, les marchés, les écoles de musique, les bars à baby…</li>\n</ul>\n<p>Cette application devra aussi permettre de :</p>\n<ul>\n<li>sauvegarder des adresses</li>\n<li>évaluer/noter les adresses (selon leur correspondance aux critères précédents)</li>\n<li>l'ouvrir à une agence afin vérifier la note de localisation d’une éventuelle proposition de location.</li>\n</ul>\n<h1>Planning technique</h1>\n<p>Un side project, c’est aussi l’occasion de tester des nouvelles techno, ou comme ce sera en partie le cas ici, de faire le point sur celles que l’on est sensé maitriser. Voici donc les objectifs techniques, plus ou moins pragmatiques :</p>\n<ul>\n<li>Se baser sur de l’<strong>open-data</strong> : l’idée est de mettre en œuvre un maximum de données normandes, plus ou moins librement et facilement disponibles.</li>\n<li><strong>Serveless</strong> : Je ne suis pas fan du terme, parce qu’au bout du compte, il y a forcement des serveurs quelque part. Mais ce ne sera pas les miens.</li>\n<li><strong>Mobile first</strong> et <strong>offline</strong> : A priori, l’utilisation classique de l’application sera sur mobile dans le rue en visite d’appartement, sans forcément avoir une bonne connexion (c’est comment la 4 g à Caen ?)</li>\n<li><strong>SPA</strong> : j’ai trouvé très pertinent l’article de <a href=\"#hate_spa\">Stefan Tilkov</a>. Mais connaissant bien l’utilisateur final de l’application, une single page fera très bien l’affaire.</li>\n<li><strong>ES6</strong> : tout le code sera en JavaScript, en profitant au maximum de l’ES6</li>\n<li><strong>React</strong> et <strong>Redux</strong> (ou pas) : je trouve intéressantes toutes les discussions actuelles sur la <a href=\"https://medium.com/search?q=javascript%20fatigue\">fatigue javascript</a>… Alors, faire du React/Redux pour faire du React/Redux ? Oui, un peu, ne serait-ce que parce que cela correspond au bootstrap actuel des projets <a href=\"http://marmelab.com/\">Marmelab</a>. Mais ce sera peut-être l’occasion d’y trouver une non-pertinence.</li>\n<li>Il faudra persister des données (sauvegarde d’adresses, points favoris), synchroniser ces données entre plusieurs devices, et que cela puisse se faire offline. Je pense donc tester quelques services du genre de <a href=\"https://www.firebase.com\">Firebase</a>, <a href=\"http://pouchdb.com/\">pouchdb</a> ou <a href=\"http://aws.amazon.com/fr/cognito/\">Amazon Cognito</a>.</li>\n</ul>\n<h1>Road to Caen</h1>\n<p>Pour finir ce post, pourquoi Road de Caen ? Et bien en référence au <strong>Road to Rouen</strong> de <em>Supergrass</em>.</p>\n<center><iframe src=\"https://embed.spotify.com/?uri=spotify:album:7HBzTTfJhW9sis8yvgxmL6&view=coverart\" width=\"300\" height=\"380\" frameborder=\"0\" allowtransparency=\"true\"></iframe></center>\n<p>Il se trouve que je pense que tous les Normands dansent sur de la pop anglaise (ma femme est de Saint-Lô). Je suis pour ma part manceau, et si par malheurs nous avions déménagé au Mans, je l’aurais appelé <a href=\"https://open.spotify.com/album/2bU6BaHfovn3rvxxxHSkWd\"><strong><em>The arguments for Le Mans</em></strong></a> ou <a href=\"https://open.spotify.com/album/2eOu9QDLP2MoO04ZtII2Vm\"><strong><em>New Day Rising In Le Mans</em></strong></a>.</p>\n<p>Dans mon prochain post, j’aborderais le bootstrap du projet, et la mise en place du MVP : les collèges liés à une adresse à Caen.</p>\n<h1>Références</h1>\n<ul>\n<li><a name=\"rural_offshore\"></a><a href=\"http://marmelab.com/blog/2015/06/11/iteration-agile.html\">L'itération agile : entre SSII et agence, un nouveau mode de prestation informatique</a></li>\n<li><a name=\"ecrire\"></a><a href=\"http://alistapart.com/column/write-what-you-know-now\">Write What You Know (Now)</a></li>\n<li><a name=\"hate_spa\"></a><a href=\"https://medium.com/@stilkov/why-i-hate-your-single-page-app-f08bb4ff9134#.bzfye46vx\">Why I hate your Single Page App</a></li>\n</ul>","frontmatter":{"title":"Road to Caen","date":"2016-01-25","tags":["Lean"],"description":"Un nouveau blog, un premier post et un titre pas très technique : je déménage cet été à Caen. "}}},"pathContext":{"slug":"road_to_caen_le_projet"}}

